precision highp float;
vec4 Ivec2ToRgba(ivec2 col) {
  vec4 rgba;
  rgba.r = fract(float(col.x) * (1.0 / 256.0)) * (256.0 / 255.0);
  rgba.a = floor(float(col.x) * (1.0 / 256.0)) * (1.0 / 255.0);  rgba.b = fract(float(col.y) * (1.0 / 256.0)) * (256.0 / 255.0);  rgba.g = floor(float(col.y) * (1.0 / 256.0)) * (1.0 / 255.0);  return rgba;
}
uniform mat4 uMVPMatrix;
uniform ivec2 styleColors[192];
uniform float cameraZoom;
attribute vec4 aPosition;
// aStyleInfo.r is the local style id. aStyleInfo.g is the offset relative to the
// style id.
attribute vec4 aStyleInfo;
varying vec4 color;
void main() {
  ivec2 style = styleColors[int(aStyleInfo.r) * 3 + int(aStyleInfo.g)];
float minZoom = aStyleInfo.b / 4.0;
float maxZoom = aStyleInfo.a / 4.0;
  bool off = style.x > 65535 || cameraZoom < minZoom
      || cameraZoom > maxZoom;
  if (off) {
    gl_Position = vec4(0.0, 0.0, 0.0, 0.0);
    return;
  }
  gl_Position = uMVPMatrix * aPosition;
  color = Ivec2ToRgba(style);
}

