precision highp float;
uniform mat4 uMVPMatrix;
attribute vec4 aPosition;
attribute vec4 aColor;
varying vec4 color;
void main() {
  gl_Position = uMVPMatrix * aPosition;
  color = aColor;
}

precision highp float;
attribute vec3 aPosition;
attribute vec2 aTextureCoord;
uniform vec2 screenSize;
uniform vec2 invTextureSize;
varying vec2 vTextureCoord;
varying vec4 vColor;
void main() {
  gl_Position.x = (aPosition.x / screenSize.x) * 2.0 - 1.0;
  gl_Position.y = (aPosition.y / screenSize.y) * -2.0 + 1.0;
  gl_Position.z = 0.0;
  gl_Position.w = 1.0;
  vTextureCoord = aTextureCoord * invTextureSize;
  vColor = vec4(aPosition.z, aPosition.z, aPosition.z, aPosition.z);
}

precision mediump float;
varying vec2 vTextureCoord;
varying vec4 vColor;
uniform sampler2D labelTexture;
void main() {
  gl_FragColor = vColor * texture2D(labelTexture, vTextureCoord);
}

precision mediump float;
void main() {
  gl_FragColor = vec4(0.0, 0.0, 0.0, 0.0);
}

precision highp float;
uniform mat4 matrix;
attribute vec4 pos;
void main() {
  gl_Position = matrix * pos;
}
